import React from "react";
import contacts from "../contacts";

function App() {
  return (
    <div>

      <contacts name="Beyone" img="https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg"
        phone="+123 456 789"
        email="b@beyonce.com"
      />
    </div>
  );
}

export default App;
